import {TProps} from "./types";
import {TableRow} from "./TableRow";

export const Table = ({headers, data}: TProps) => {
  return (
    <table style={{width: '100%'}}>
      <thead>
        <tr>
          {headers.map(header => {
            return (
              <th>{header}</th>
            )
          })}
        </tr>
      </thead>
      <tbody>
        {data.map((dataItem: any) => {
          return <TableRow option={dataItem} data={data}/>
        })}
      </tbody>
    </table>
  )
}
